# Uses python3import sysimport randomdef partition3(a, l, r):    num = 1    j = l + 1    for i in range(l + 1, r + 1):        if a[i] == a[l]:            a[i], a[j] = a[j], a[i]            j += 1            num += 1    m2 = partition2(a, l + num - 1, r)    for i in range(1, num):        a[m2 - i], a[l + i - 1] = a[l + i - 1], a[m2 - i]    m1 = m2 - num + 1    return m1, m2def partition2(a, l, r):    x = a[l]    j = l    for i in range(l + 1, r + 1):        if a[i] <= x:            j += 1            a[i], a[j] = a[j], a[i]    a[l], a[j] = a[j], a[l]    return jdef randomized_quick_sort(a, l, r):    if l >= r:        return    k = random.randint(l, r)    a[l], a[k] = a[k], a[l]    #use partition3    # m = partition2(a, l, r)    m1, m2 = partition3(a, l, r)    randomized_quick_sort(a, l, m1 - 1)    randomized_quick_sort(a, m2 + 1, r)if __name__ == '__main__':    input = sys.stdin.read()    n, *a = list(map(int, input.split()))    randomized_quick_sort(a, 0, n - 1)    for x in a:        print(x, end=' ')